DROP DATABASE `db_pokehub`;
CREATE DATABASE `db_pokehub`;
USE `db_pokehub`;

CREATE TABLE `utente` (
  `mail` varchar(50) NOT NULL,
  `cellulare` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  `nome` varchar(50) NOT NULL,
  `cognome` varchar(50) NOT NULL,
  `categoria_utente` enum('Amministratore','Cliente') NOT NULL,
  PRIMARY KEY (`mail`)
);

