CREATE TABLE `categoria` (
  `nome_categoria` varchar(50) NOT NULL,
  PRIMARY KEY (`nome_categoria`)
);

INSERT INTO `categoria` VALUES ('Accessori'),('Accessori elettronici'),('Categoria1'),('Categoria2'),('prova');

CREATE TABLE `indirizzo` (
  `id_indirizzo` int NOT NULL AUTO_INCREMENT,
  `mail_cliente` varchar(50) NOT NULL,
  `via` varchar(50) NOT NULL,
  `civico` varchar(50) NOT NULL,
  `telefono` varchar(50) NOT NULL,
  `cap` varchar(50) NOT NULL,
  PRIMARY KEY (`id_indirizzo`,`mail_cliente`),
  CONSTRAINT `FK_MailCliente-Indirizzo` FOREIGN KEY (`mail_cliente`) REFERENCES `utente` (`mail`) ON DELETE CASCADE ON UPDATE CASCADE
);

