CREATE TABLE `ordine` (
  `id_ordine` int NOT NULL AUTO_INCREMENT,
  `mail_cliente` varchar(50) NOT NULL,
  `id_indirizzo` int NOT NULL,
  `traking_ordine` varchar(50) NOT NULL,
  `data_ordine` date NOT NULL,
  `status_consegna` enum('IN CONSEGNA','CONSEGNATO') NOT NULL,
  `via` varchar(50) NOT NULL,
  `civico` varchar(50) NOT NULL,
  `cap` varchar(50) NOT NULL,
  `telefono` varchar(50) NOT NULL,
  PRIMARY KEY (`id_ordine`),
  CONSTRAINT `FK_Ordine-Mail` FOREIGN KEY (`mail_cliente`) REFERENCES `indirizzo` (`mail_cliente`) ON DELETE RESTRICT ON UPDATE CASCADE
);

CREATE TABLE `pagamento` (
  `numero_carta` varchar(50) NOT NULL,
  `mail_cliente` varchar(50) NOT NULL,
  `intestatario_carta` varchar(50) NOT NULL,
  `cvv` varchar(50) NOT NULL,
  `scadenza` date NOT NULL,
  PRIMARY KEY (`numero_carta`,`mail_cliente`),
  CONSTRAINT `FK_MailCliente-Pagamento` FOREIGN KEY (`mail_cliente`) REFERENCES `utente` (`mail`) ON DELETE RESTRICT ON UPDATE CASCADE
);

