CREATE TABLE `prodotto` (
  `id_prodotto` int NOT NULL AUTO_INCREMENT,
  `nome_prodotto` varchar(50) NOT NULL,
  `prezzo_vetrina` decimal(10,2) NOT NULL,
  `descrizione` varchar(2000) NOT NULL,
  `iva` decimal(4,2) NOT NULL,
  `prodotto_mostrato` tinyint(1) NOT NULL,
  `categoria_prodotto` varchar(50) NOT NULL,
  `quantita` int NOT NULL,
  `immagine_prodotto` longblob,
  PRIMARY KEY (`id_prodotto`),
  CONSTRAINT `FK_CategoriaProdotto-Prodotto` FOREIGN KEY (`categoria_prodotto`) REFERENCES `categoria` (`nome_categoria`) ON DELETE RESTRICT ON UPDATE CASCADE
);

