CREATE TABLE `valutazione` (
  `mail_cliente` varchar(50) NOT NULL,
  `identificativo_prodotto` int NOT NULL,
  `descrizione` varchar(2000) NOT NULL,
  `punteggio` int NOT NULL,
  PRIMARY KEY (`mail_cliente`,`identificativo_prodotto`),
  CONSTRAINT `FK_IdentificativoProdotto-Valutazione` FOREIGN KEY (`identificativo_prodotto`) REFERENCES `prodotto` (`id_prodotto`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_MailCliente-Valutazione` FOREIGN KEY (`mail_cliente`) REFERENCES `utente` (`mail`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `controlloVotoMassimo` CHECK ((`punteggio` <= 5)),
  CONSTRAINT `controlloVotoMinimo` CHECK ((`punteggio` >= 1))
);

CREATE TABLE `composizione` (
  `identificativo_prodotto` int NOT NULL,
  `identificativo_ordine` int NOT NULL,
  `quantit` int NOT NULL,
  `prezzo_acquisto` decimal(10,2) NOT NULL,
  `iva_acquisto` decimal(4,2) NOT NULL,
  PRIMARY KEY (`identificativo_prodotto`,`identificativo_ordine`),
  CONSTRAINT `FK_IDOrdine-Composizione` FOREIGN KEY (`identificativo_ordine`) REFERENCES `ordine` (`id_ordine`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `FK_IDProdotto-Composizione` FOREIGN KEY (`identificativo_prodotto`) REFERENCES `prodotto` (`id_prodotto`) ON DELETE RESTRICT ON UPDATE CASCADE
);